// src/Title.js
import { isObject } from 'lodash';
import React from 'react'
import './Title.css';


function Title() {
  return (
    <div className="Title">
      <Image
      style={styles.tinyLogo}
      source="../public/header-img.png"
      />
    </div>
  )
}

export default Title
